  //    await axios.get(photo_url)
  //    .then(res => setPic(res.data.results[0].links.download)
     
  //    )
  //     console.log(pic)
      
    
      // console.log(res[0])
      // .catch((err) => console.log(err));
  // };

  const row = function row() {
    return tableData.slice(0, 20).map((el) => (
      <tr onClick={(e) => onClickPic(el.comName)} className={el.comName}>
        <td colSpan="1">{el.comName}</td>
        <td colSpan="1">{el.sciName}</td>
        <td>{el.locName}</td>
        <td>{el.obsDt}</td>
      </tr>
    ));
  };

  return (
    <div>
      <thead>
        <tr>
          <th colSpan="1" scope="col">
            Common Name
          </th>
          <th colSpan="1" scope="col" data-label="Scientific Name">
            Scientific Name
          </th>
          <th colSpan="1">Location</th>
          <th colSpan="1">Date</th>
        </tr>
      </thead>
      <tbody>{row()}</tbody>
      {/* <Image pic={pic} /> */}
    </div>
  );
}
